import styled from 'styled-components';

export const LoginWrapper = styled.div`
	position: absolute;
	left: 0;
	right: 0;
	bottom: 0;
	top: 56px;
	background: #eee;
	z-index: 0;
`;

export const LoginBox = styled.div`
	width: 400px;
	height: 220px;
	margin: 80px auto;
	background: #fff;
	padding-top: 20px;
	box-shadow: 0 0 8 rgba(0,0,0,0.1);
`;

export const Input = styled.input`
	display: block;
	width: 200px;
	height: 30px;
	line-height: 30px; 
	padding: 0 10px;
	margin: 10px 0;
	color: #777; 
`;
